export default (function(a,b,c,d,e){return {data:{pv7gQuN5Rb:{data:{id:1039,attributes:{imdbId:"tt11086670",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDk2NWVlZTItY2E5ZS00N2UzLThmZWQtMWE5MzU4MmIxNTc3XkEyXkFqcGdeQXVyMTAzNTUyMzE0._V1_SX300.jpg",type:"movie",ratings:[],item_lang:{data:{id:1702,attributes:{title:e,plot:"Ten dancers of the legendary Pina Bausch Tanztheater Wuppertal celebrate the magic of the everyday in an emotional ballet of personalities and relationships.",slug:"fallen"}}},books:{data:[{id:6014,attributes:{title:e,description:"Read FALLEN, the worldwide sensation that's both dangerously exciting and darkly romantic. #1 New York Times bestseller A USA Today bestseller One of NPR.com's 100 Best-Ever Teen Novels More than 3 million series copies in print! There's something achingly familiar about Daniel Grigori. Mysterious and aloof, he captures Luce Price's attention from the moment she sees him on her first day at the Sword & Cross boarding school in sultry Savannah, Georgia. He's the one bright spot in a place where cell phones are forbidden, the other students are all screw-ups, and security cameras watch every move. Even though Daniel wants nothing to do with Luce--and goes out of his way to make that very clear--she can't let it go. Drawn to him like a moth to a flame, she has to find out what Daniel is so desperate to keep secret . . . even if it kills her. \"Sexy and fascinating and scary . . . I loved loved loved it!\"--New York Times bestselling author P.C. Cast",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8H8WfZ_AyU8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2009-12-08",publisher:b,subtitle:c}},{id:6015,attributes:{title:"Fallen in Love",description:"Unexpected. Unrequited. Forbidden. Eternal. Everyone has their own love story. A USA Today bestseller More than 3 million series copies in print! And in a twist of fate, four extraordinary love stories intersect over the course of a romantic Valentine’s Day in medieval England. Miles and Shelby find love where they least expect it. Roland learns a painful lesson about finding and losing love. Arriane pays the price for a love so fierce it burns. And for the first—and last—time, Daniel and Luce spend a night together like none other. Lauren Kate’s FALLEN IN LOVE is filled with love stories . . . the ones everyone has been waiting for. “Sexy and fascinating and scary . . . I loved loved loved it!” —P. C. Cast, New York Times bestselling author on Fallen",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pV-tb0OV0ooC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2012-01-24",publisher:b,subtitle:c}},{id:6016,attributes:{title:"Unforgiven",description:"Every story has a dark side, and this story belongs to Cam, the brooding, bad-boy dark angel FALLEN readers love. High school can be hell. Cam knows what it’s like to be haunted. He’s spent more time in Hell than any angel ever should. And his freshest Hell is high school, where Lilith, the girl he can’t stop loving, is serving out a punishment for his crimes. Cam made a bet with Lucifer: he has fifteen days to convince the only girl who really matters to him to love him again. If he succeeds, Lilith will be allowed back into the world, and they can live their lives together. But if he fails . . . there’s a special place in Hell just for him. Tick-tock. Spread your wings and cry as bad boy dark angel Cam finally reveals his anguished heart in the epic FALLEN novel, UNFORGIVEN.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O0qwBgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2015-11-10",publisher:b,subtitle:c}},{id:6017,attributes:{title:"Torment",description:"The second novel in the addictive and worldwide bestselling FALLEN series . . . where love never dies. #1 New York Times bestseller A USA Today Bestseller More than 3 million series copies in print! Hell on earth. That’s what it’s like for Luce to be apart from her fallen angel boyfriend, Daniel. It took them an eternity to find one another, but now he has told her he must go away. Just long enough to hunt down the Outcasts—immortals who want to kill Luce. Daniel hides Luce at Shoreline, a school on the rocky California coast with unusually gifted students: Nephilim, the offspring of fallen angels and humans. At Shoreline, Luce learns what the Shadows are, and how she can use them as windows to her previous lives. Yet the more Luce learns, the more she suspects that Daniel hasn’t told her everything. He’s hiding something—something dangerous. What if Daniel’s version of the past isn’t actually true? What if Luce is really meant to be with someone else? “Sexy and fascinating and scary . . . I loved loved loved it!” —P. C. Cast, New York Times bestselling author on Fallen",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B9xs2TtyVuMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2010-09-28",publisher:b,subtitle:c}},{id:6018,attributes:{title:"Passion",description:"Sweeping across centuries, PASSION is the third novel in the unforgettably epic and worldwide bestselling FALLEN series. A New York Times bestseller A USA Today bestseller More than 3 million series copies in print! Luce would die for Daniel. And she has. Over and over again. Throughout time, Luce and Daniel have found each other, only to be painfully torn apart: Luce dead, Daniel left broken and alone. But perhaps it doesn’t need to be that way. . . . Luce is certain that something—or someone—in a past life can help her in her present one. So she begins the most important journey of this lifetime . . . going back eternities to witness firsthand her romances with Daniel . . . and finally unlock the key to making their love last. Cam and the legions of angels and Outcasts are desperate to catch Luce, but none are as frantic as Daniel. He chases Luce through their shared pasts, terrified of what might happen if she rewrites history. Because their romance for the ages could go up in flames . . . forever. “Sexy and fascinating and scary . . . I loved loved loved it!” —P. C. Cast, New York Times bestselling author on Fallen",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XP1CAHMaRwoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2011-06-14",publisher:b,subtitle:c}}]}}},meta:{}}},prerenderedAt:1680940965822}}("Lauren Kate","Delacorte Press","",null,"Fallen"))